import React from 'react';
import Navbar from './Navbar';
import './Home.css';

export default function Home() {
  return (
    <div>
      <Navbar />
      <div className="container home-content" style={{ marginTop: '80px' }}>
        <div className="row align-items-center">
          {/* Left Column */}
          <div className="col-md-6">
            <h1 className="hero-title text-start">Your Personal</h1>
            <h1 className="hero-title text-start">AI Health Assistant</h1>
            <p className="hero-subtitle">
              Now say goodbye to Google scares! <br/>Available for FREE, 24x7 on WhatsApp.
            </p>
          </div>

          {/* Right Column - You can replace 'second' with an image or illustration */}
          <div className="col-md-6">
            <img
              src="/path/to/illustration.png"
              alt="AI Assistant"
              className="img-fluid"
            />
          </div>
        </div>
      </div>
    </div>
  );
}
